import { useState, useEffect } from "react";

function Hello() {
  return (
    <h3>Hello !</h3>
  )
}

function App() {
  const [showing, setShowing] = useState(false);
  const onClick = () => setShowing(!showing);
  return (
    <div>
      <button onClick={onClick}>{showing ? "show" : "hide"}</button>
      {showing ? <Hello /> : null}
    </div>
  );
}

export default App;
